import React, { Component } from "react";

class Popup extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="menu">
        <button class="hamburger hamburger--collapse is-active" type="button">
          <span class="hamburger-box">
            <span class="hamburger-inner" />
          </span>
        </button>
      </div>
    );
  }
}

export default Popup;
